import React from 'react';

import './header.css';

const Header = () => (
   <div className="header">
      <div className="homeItem">Home</div>
      <div className="headerItem">About</div>
      <div className="headerItem">Contact</div>
      <div className="headerItem">Login/Register</div>
      <div className="headerItem">Profile</div>
   </div>
)

export default Header;
